import { Box, Button, Dialog, DialogActions, DialogContent, DialogTitle, FormControl, InputLabel, MenuItem, NativeSelect, Select, TextField } from "@material-ui/core"
import { useEffect, useState } from "react";
import axios from 'axios';
import { useForm } from "react-hook-form";

interface ClientType{
    _id?:string,
    company_name:string,
}

const Branch = () => {

    useEffect(() => {
        axios.get('api/client/name')
            .then(({data}) => {console.log(data);setClients(data)});
    },[]);

    const [open, setOpen] = useState<boolean>(false);
    const [clients , setClients] = useState<ClientType[]>(null);

    const [age, setAge] = useState<number>();

    const { register, handleSubmit, watch, formState: { errors } } = useForm();
    const onSubmit = data => {console.log(data);}


    const handleChange = (event: React.ChangeEvent<{ value: unknown }>) => {};

    const handleClose = () => {
        setOpen(false);
    };

    return (

        <Box m={5}>

            <Button color="primary" variant="outlined" onClick={() => setOpen(true)}>Add Branch</Button>

            <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                <DialogTitle id="form-dialog-title">Add New Branch</DialogTitle>

                <form onSubmit={handleSubmit(onSubmit)}>
                    <DialogContent>

                        <InputLabel id="label" >Client</InputLabel>
                        <Select {...register("client_id")} labelId="label" id="select" fullWidth variant="outlined">
                            <MenuItem value="" disabled>
                                <em>None</em>
                            </MenuItem>
                            {clients?.map(client => (
                                <MenuItem value={client._id}> {client.company_name} </MenuItem>
                            ))}
                        </Select>

                        {/* <TextField id="select" label="Client" value="20" select fullWidth variant="outlined">
                            <MenuItem value="10">Ten</MenuItem>
                            <MenuItem value="20">Twenty</MenuItem>
                        </TextField> */}

                        <TextField {...register("address", { required: "Address is requied!" })}
                            autoFocus variant="outlined" margin="normal" id="address" label="Address" type="text" fullWidth 
                        />

                    </DialogContent>

                    <DialogActions>
                        <Button onClick={handleClose} color="primary">
                            Save
                        </Button>
                        <Button onClick={() => setOpen(false)} color="primary">
                            Close
                        </Button>
                    </DialogActions>
                </form>

            </Dialog>

        </Box>
    )
}

export default Branch
